import React from 'react'
import './Header.css'
import MenuSharpIcon from '@mui/icons-material/MenuSharp';
import SearchSharpIcon from '@mui/icons-material/SearchSharp';
import VideoCallSharpIcon from '@mui/icons-material/VideoCallSharp';
import MicSharpIcon from '@mui/icons-material/MicSharp';
import NotificationsNoneSharpIcon from '@mui/icons-material/NotificationsNoneSharp';
import { Avatar } from '@mui/material';

// es7 snippets extension used from VSC


function Header() {
    return (
        <div className="header">
            {/* <h1>I am a Header</h1>*/}
            <MenuSharpIcon />
            <img clasName="header__logo" src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/YouTube_Logo_2017.svg/1024px-YouTube_Logo_2017.svg.png?20220605194644"
                alt=""
            />
            <input type="text" />
            <MicSharpIcon />
            <SearchSharpIcon />
            <VideoCallSharpIcon />
            <NotificationsNoneSharpIcon />
            <Avatar
                style="width:30px;height:auto;"
                alt="Aayush Gupta"
                src="https://yt3.ggpht.com/yti/AOXPAcWgx2gYAORr1otBgCQjSKJKoiPmSMrNTKKIkQ=s88-c-k-c0x00ffffff-no-rj"
            />


        </div>
    );
}

export default Header
